import React, { Component } from "react";
import "./header.css";
import people from "../../assets/people.png";
import ai from "../../assets/ai.png";
import computer from "../../assets/computer.png";
import download from "../../assets/download.png";
import { Button } from "reactstrap";
import jsPDF from "jspdf";
import resume from "../../assets/resume.pdf";

const Header = () => {
  const pdfGe = () => {
    var doc = new jsPDF("landscape", "px", "a4", "false");
    doc.addImage(resume, "PNG", 65, 20, 500, 400);
    doc.save("resume.pdf");
  };
  return (
    <div className="gpt3__header section__padding" id="home">
      <div className="gpt3__header-content">
        <h1 className="">Hello! I'm Phanit Phou</h1>
        <p>
          I am a junior web developer based in Louisville, ky who loves to learn
          new things
        </p>
        <div className="gpt3__header-content__input">
          <input type="email" placeholder="Write me an email" />
          <button type="button">Send</button>
        </div>
        <div className="gpt3__header-content__people">
          <img src={download} />

          <Button onClick={pdfGe}>
            <p>Download resume</p>
          </Button>
        </div>
      </div>
      <div className="gpt3__header-image">
        <img src={computer} alt="computer" />
      </div>
    </div>
  );
};

export default Header;
